import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import Button from '@mui/material/Button';
import { styled } from '@mui/material/styles';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import FormLabel from '@mui/material/FormLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import Link from '@mui/material/Link';

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  '& .MuiDialogContent-root': {
    padding: theme.spacing(2),
  },
  '& .MuiDialogActions-root': {
    padding: theme.spacing(1),
  },
}));

export interface DialogTitleProps {
  id: string;
  children?: React.ReactNode;
  onClose: () => void;
}

function BootstrapDialogTitle(props: DialogTitleProps) {
  const { children, onClose, ...other } = props;

  return (
    <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
      {children}
      {onClose ? (
        <IconButton
          aria-label="close"
          onClick={onClose}
          sx={{
            position: 'absolute',
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton>
      ) : null}
    </DialogTitle>
  );
}

function App() {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  const [Schema, setSchema] = React.useState('');

  const handleChange = (event) => {
    setSchema(event.target.value);
  };


  return (
    <div className="App">
      <Button variant="outlined" onClick={handleClickOpen}>Save Segment</Button>
      <BootstrapDialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open}>
        <BootstrapDialogTitle id="customized-dialog-title" onClose={handleClose}>
          Saving Segment
        </BootstrapDialogTitle>
        <DialogContent dividers>
          <FormControl fullWidth>
            <FormLabel style={{ marginBottom: 10, color: '#000' }}>Enter the Name of the Segment</FormLabel>
            <TextField style={{ marginBottom: 20 }} id="txtName" variant="outlined" />
            <FormLabel style={{ marginBottom: 30, color: '#000' }}>To save your segment, you need to add the schemas to build the query</FormLabel>
            <Select
              id="ddlSchema"
              value={Schema}
              displayEmpty
              style={{ marginBottom: 10 }}
              inputProps={{ 'aria-label': 'Without label' }}
              onChange={handleChange}
            >
              <MenuItem value="">--Add schema to segment--</MenuItem>
              <MenuItem value="first_Name">First Name</MenuItem>
              <MenuItem value="last_Name">Last Name</MenuItem>
              <MenuItem value="gender">Gender</MenuItem>
              <MenuItem value="age">Age</MenuItem>
              <MenuItem value="account_name">Account Name</MenuItem>
              <MenuItem value="city">City</MenuItem>
              <MenuItem value="state">State</MenuItem>
            </Select>
            <Link href="#">+ Add new schema</Link>
          </FormControl>


          {/* <Typography gutterBottom>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur et.
            Vivamus sagittis lacus vel augue laoreet rutrum faucibus dolor auctor.
          </Typography>
          <Typography gutterBottom>
            Aenean lacinia bibendum nulla sed consectetur. Praesent commodo cursus
            magna, vel scelerisque nisl consectetur et. Donec sed odio dui. Donec
            ullamcorper nulla non metus auctor fringilla.
          </Typography> */}
        </DialogContent>
        <DialogActions>
          <Button variant="outlined" autoFocus onClick={handleClose}>
            Cancel
          </Button>
          <Button variant="outlined" autoFocus onClick={handleClose}>
            Save the Segment
          </Button>
        </DialogActions>
      </BootstrapDialog>
    </div >
  );
}

export default App;
